import React from 'react';
import ReactDOM from 'react-dom';
import 'mapbox-gl/dist/mapbox-gl.css';
import './index.css';
import Map from './Map';
import Test from './test';

ReactDOM.render(
  <React.StrictMode>
    <Map />
    <Test/>
  </React.StrictMode>,
  document.getElementById('root')
);
